package com.company.nate.String;

import java.util.HashMap;
import java.util.Map;

public class p4 {

    static public boolean isAnagram(String s, String t) {

        if (s.length() != t.length()) {
            return false;
        }

        HashMap<Character, Integer> mapS = new HashMap();
        char[] sArr = s.toCharArray();
        for (int i = 0; i <sArr.length ; i++) {

            Character key = Character.valueOf(sArr[i]);
            Integer value = mapS.get(key) == null ? 1 : mapS.get(key) + 1;
            mapS.put(key, value);
        }


        HashMap<Character, Integer> mapT = new HashMap();
        char[] tArr = t.toCharArray();
        for (int i = 0; i <tArr.length ; i++) {

            Character key = Character.valueOf(tArr[i]);
            Integer value = mapT.get(key) == null ? 1 : mapT.get(key) + 1;
            mapT.put(key, value);
        }

        if (!mapS.keySet().equals(mapT.keySet())) {
            return false;
        }

        for (Character key:mapS.keySet()) {

            Integer value1 = mapS.get(key);
            Integer value2 = mapT.get(key);

            if (!value1.equals(value2)) {
                return false;
            }
        }

        return true;
    }

    public static void main(String[] args) {

        boolean str =  isAnagram("","");
        System.out.println(str);
    }



}
